import calculateFromTemp from './yield.c';
import calculateFromRain from './yield.c';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <h>Agriculture Project</h>
       <h>{calculateFromTemp(70)}</h>
      </header>
    </div>
  );
}

export default App;
